(83, 'widget_text', 'a:6:{i:2;a:3:{s:5:"title";s:16:"About Atmosferiq";s:4:"text";s:523:"Lorem ipsum dolor sit amet, consectetur adipiscing elit. Curabitur pretium lobortis leo, sit amet dictum quam bibendum vitae. Maecenas a posuere enim. In velit ipsum, laoreet eu commodo sit amet, vulputate viverra erat. Sed euismod cursus sapien, quis eleifend elit. Nulla feugiat lacus eu nisl blandit viverra. Sed adipiscing sem vel convallis tincidunt. Morbi turpis risus, eleifend a ultrices vel, viverra eget urna. Donec volutpat, ante eget accumsan ultrices, lorem ante adipiscing felis, sed congue neque leo ut purus";s:6:"filter";b:0;}i:3;a:3:{s:5:"title";s:16:"About Atmosferiq";s:4:"text";s:369:"Atmosferiq is marketing-mix management software that integrates online and offline channels into a single tool. Our subscription-based platform allows progressive marketers of small- and medium-sized businesses to integrate all channels into one place, correlate multichannel activity, improve the efficiency of marketing spend, and, ultimately, reveal more customers. ";s:6:"filter";b:1;}i:5;a:3:{s:5:"title";s:26:"Business Owner Testimonial";s:4:"text";s:303:"<img class="img-responsive img-circle" src="http://placehold.it/150x150">\r\n<p>"There is 100% a need for this type of tool and it should hit home to any SMB. The current time spent is a significant cost and this would save us a huge amount of time."</p>\r\n\r\n<p><strong>John Henne</strong>—Henne Jewelers";s:6:"filter";b:0;}i:6;a:3:{s:5:"title";s:29:"Marketing Manager Testimonial";s:4:"text";s:305:"<img class="img-responsive img-circle" src="http://placehold.it/150x150">\r\n\r\n<p>"There is 100% a need for this type of tool and it should hit home to any SMB. The current time spent is a significant cost and this would save us a huge amount of time."</p>\r\n\r\n<p><strong>John Henne</strong>—Henne Jewelers";s:6:"filter";b:0;}i:7;a:3:{s:5:"title";s:25:"Media Planner Testimonial";s:4:"text";s:302:"<img class="img-responsive img-circle" src="http://placehold.it/150x150">\r\n\r\n<p>"The dashboard alone is like discovering gold for an ad agency. We spend too much time in too many places trying to find some of this basic info for our clients".</p>\r\n\r\n<p><strong>Diane Walter</strong>—Mullen Pittsburgh";s:6:"filter";b:0;}s:12:"_multiwidget";i:1;}', 'yes'),
