(526, 55, 'archetype_features', 'a:22:{s:9:"cta-title";s:32:"All your channels. One Platform.";s:15:"cta-description";s:85:"Bring all your tools together and focus on developing insights, not chasing channels.";s:10:"cta-button";s:23:"Start Your 30-Day Trial";s:9:"cta-image";s:67:"http://atmosferiq.com/wp-content/uploads/2013/12/manager_header.png";s:6:"story1";s:157:"Your customer lives in a multi-channel world, and connecting with them on a lean budget and an endless assortment of engagement tools can be near-impossible.";s:6:"story2";s:557:"We make it possible for marketers to analyze the effectiveness of their marketing activities by providing a single, comprehensive dashboard to view and understand online and offline customer engagement. By integrating digital and traditional marketing channels into a single dashboard, marketers can see the activation of any marketing activity across all channels, not just the one they published through. As a result, marketers can make more informed decisions about where and when to make advertising buys and plan more effective multi-channel campaigns.";s:14:"feature-title1";s:36:"See Traditional and Digital Together";s:13:"feature-icon1";s:26:"<i class="fa fa-link"></i>";s:20:"feature-description1";s:155:"Use your timeline to discover the relationships, customer activation, seasonal trends, and engagement patterns across multiple online and offline channels.";s:14:"feature-title2";s:22:"Optimize Marketing Mix";s:13:"feature-icon2";s:27:"<i class="fa fa-tasks"></i>";s:20:"feature-description2";s:126:"Iterate your marketing approach within a budget to be sure that unnecessary marketing expenses don’t throw off sales goals. ";s:14:"feature-title3";s:26:"Company-Wide Collaboration";s:13:"feature-icon3";s:30:"<i class="fa fa-exchange"></i>";s:20:"feature-description3";s:102:"Create additional accounts to easily collaborate with owners and team members, regardless of location.";s:17:"testimonial-title";s:45:"MARKETING MIX MANAGEMENT MATTERS TO MARKETERS";s:11:"testimonial";s:144:"The ability to match our marketing spend versus our goals to figure out a ROI is huge for us and will fill a major gap in our marketing process";s:16:"testimonial-cite";s:62:"<strong>Director of Marketing</strong>, Local Automotive Group";s:17:"testimonial-image";s:77:"http://atmosferiq.com/wp-content/uploads/2013/12/marketing_manager_bottom.png";s:14:"violator-title";s:44:"Never Get Caught Without Knowing the Whether";s:20:"violator-description";s:35:"Start your free 30-day trial today.";s:12:"violator-btn";s:11:"Get Started";}'),
