(518, 20, 'archetype_features', 'a:22:{s:9:"cta-title";s:48:"INTEGRATED MARKETING MIX MANAGEMENT FOR AGENCIES";s:15:"cta-description";s:78:"Use the time you used to spend on reports creating business-changing insights.";s:10:"cta-button";s:11:"Get Started";s:9:"cta-image";s:66:"http://atmosferiq.com/wp-content/uploads/2013/12/agency_header.png";s:6:"story1";s:197:"All marketing and advertising agencies are under pressure to stay current on the ever-evolving landscape of customer engagement, while still finding time to manage the existing plan and activities.";s:6:"story2";s:431:"Atmosferiq provides agencies a single platform to track and manage every channel for every client, eliminating hours of work in synthesizing and reporting so that marketers can focus on what''s really essential - studying activity and providing actionable insights. Our tools aggregate multi-channel marketing into a customer dashboard and intuitive timeline view to give marketers in-depth, up-to-date customer engagement activity.";s:14:"feature-title1";s:36:"Manage All Your Clients in One Place";s:13:"feature-icon1";s:30:"<i class="fa fa-umbrella"></i>";s:20:"feature-description1";s:108:"Efficiently view and manage the online and offline marketing activity of every client from a single account.";s:14:"feature-title2";s:32:"Collaborate to Increase Insights";s:13:"feature-icon2";s:27:"<i class="fa fa-users"></i>";s:20:"feature-description2";s:163:"Create additional accounts with flexible permissions to easily share insights with and and collect additional information from clients and other channel resources.";s:14:"feature-title3";s:17:"Help us help you ";s:13:"feature-icon3";s:28:"<i class="fa fa-trophy"></i>";s:20:"feature-description3";s:128:"As an Atmosferiq agency partner, utilize exclusive incentives and resources to build a scalable, predictable source of business.";s:17:"testimonial-title";s:61:"MEDIA PLANNERS ARE MANAGING THEIR MIX TO MAXIMIZE THEIR REACH";s:11:"testimonial";s:163:"The Dashboard alone is like discovering gold for an ad agency. We spend too much time in too many places trying to find some of this basic info for our clients.\r\n";s:16:"testimonial-cite";s:72:"<strong>VP Digital Operations</strong>, Marketing and Advertising Agency";s:17:"testimonial-image";s:68:"http://atmosferiq.com/wp-content/uploads/2013/12/agencies_bottom.png";s:14:"violator-title";s:44:"Never Get Caught Without Knowing the Whether";s:20:"violator-description";s:35:"Start your free 30-day trial today.";s:12:"violator-btn";s:11:"Get Started";}'),
