(527, 52, 'archetype_features', 'a:22:{s:9:"cta-title";s:26:"Master your marketing mix.";s:15:"cta-description";s:67:"Make better decisions about where to spend on customer acquisition.";s:10:"cta-button";s:23:"Start Your 30-Day Trial";s:9:"cta-image";s:70:"http://atmosferiq.com/wp-content/uploads/2013/12/business_header_3.png";s:6:"story1";s:185:"Business owners are always on the go. They often manage all parts of their business on the fly, leaving little time to focus on the complex and ever-changing opportunities in marketing.";s:6:"story2";s:385:"We give owners high-level visibility into their marketing, helping them to plan within their marketing budget, eliminate reactionary or ineffective spending, and create more targeted customer converting marketing campaigns. And with an ever-growing collection of supported marketing channels, we’ll help business owners identify, understand, and plan for new marketing opportunities.";s:14:"feature-title1";s:22:"Get Context in Minutes";s:13:"feature-icon1";s:34:"<i class="fa fa-check-circle"></i>";s:20:"feature-description1";s:111:"Onboard all of your channels—both online and offline—and achieve a new understanding of your marketing mix.";s:14:"feature-title2";s:32:"Simply Plan and Manage Marketing";s:13:"feature-icon2";s:28:"<i class="fa fa-wrench"></i>";s:20:"feature-description2";s:167:"We’ll help you build and maintain a marketing plan that’s tailored to your business. From there, you can factor all new opportunities against an established plan. ";s:14:"feature-title3";s:26:"Create Actionable Insights";s:13:"feature-icon3";s:33:"<i class="fa fa-bar-chart-o"></i>";s:20:"feature-description3";s:210:"With all online and offline metrics reported in a single timeline view, you can study the activity of all channels together to see what methods are affecting sales, and—more importantly—which ones aren’t.";s:17:"testimonial-title";s:53:"SMALL BUSINESS OWNERS ARE BEGGING FOR THIS VISIBILITY";s:11:"testimonial";s:159:"There is 100% need for this type of tool and it should hit home to any SMB. The current time spent is a significant cost and this would save us hours per week.";s:16:"testimonial-cite";s:37:"<strong>Owner</strong>, Jewelry Store";s:17:"testimonial-image";s:75:"http://atmosferiq.com/wp-content/uploads/2013/12/business_bottom_image2.png";s:14:"violator-title";s:44:"Never Get Caught Without Knowing the Whether";s:20:"violator-description";s:35:"Start your free 30-day trial today.";s:12:"violator-btn";s:11:"Get Started";}'),
