(586, 9, 'features_breakdown', 'a:36:{s:13:"heading-title";s:33:"MARKETING MIX MANAGEMENT SOFTWARE";s:19:"heading-description";s:166:"Atmosferiq helps business owners make smarter decisions, removes the chaos of channel management for marketing managers, and gives agencies time to focus on insights.";s:14:"heading-title1";s:53:"MANAGE YOUR MARKETING MIX IN AS LITTLE AS TEN MINUTES";s:20:"heading-description1";s:118:"Simply connect digital channels and tell us a little about traditional ones, and Atmosferiq will begin reporting data.";s:14:"feature-title1";s:26:"Connected Digital Channels";s:14:"feature-image1";s:64:"http://atmosferiq.com/wp-content/uploads/2013/12/features_03.png";s:20:"feature-description1";s:162:"We’ve connected the APIs of the worlds most popular social tools to create a single view of all digital channel activity—and we are adding new ones each week.";s:14:"feature-title2";s:39:"“Personalized” Traditional Channels";s:14:"feature-image2";s:64:"http://atmosferiq.com/wp-content/uploads/2013/12/features_05.png";s:20:"feature-description2";s:286:"We’ve created a tool to allow you to select and define your use of traditional media in the same way you view your digital tools. Choose specific stations, publications, and other outlets you use to advertise and then just add information about each insertion, placement or print run.";s:14:"feature-title3";s:29:"Quick Dashboard Configuration";s:14:"feature-image3";s:64:"http://atmosferiq.com/wp-content/uploads/2013/12/features_07.png";s:20:"feature-description3";s:164:"Configure your dashboard to display the metrics that matter most with the ability to easily drill in for additional context on any channel without leaving the tool.";s:14:"heading-title2";s:40:"ALL YOUR CHANNELS IN ONE PLACE—AT LAST";s:20:"heading-description2";s:128:"See what’s happening across all of your marketing channels and drill in to better understand how one channel affects another. ";s:16:"feature-image2-1";s:73:"http://atmosferiq.com/wp-content/uploads/2013/12/dashboard_features_3.png";s:16:"feature-title2-1";s:34:"Powerful, Timeline-based Analytics";s:22:"feature-description2-1";s:106:"Evaluate your channel performance at a glance and begin to identify trends and patterns in your marketing.";s:16:"feature-title2-2";s:23:"Marketing Mix Dashboard";s:22:"feature-description2-2";s:122:"Start with a high level view of marketing activity and performance and drill in deeper on any channel with a single click.";s:16:"feature-title2-3";s:24:"Integrated Understanding";s:22:"feature-description2-3";s:188:"Identify the relationship between multiple channels, and annotate real-world events within your timeline to better understand what’s happening with your customers, fans and followers. \r\n";s:14:"heading-title3";s:27:"Keep Your Marketing On Plan";s:20:"heading-description3";s:75:"Atmosferiq has the tools to help you create your marketing plans and goals.";s:16:"feature-title3-1";s:26:"Marketing Spend Management";s:16:"feature-image3-1";s:64:"http://atmosferiq.com/wp-content/uploads/2013/12/features_13.png";s:22:"feature-description3-1";s:99:"Build a marketing budget or import your own, and view a consolidated plan of total marketing spend.";s:16:"feature-title3-2";s:26:"Flexible Goals and Metrics";s:16:"feature-image3-2";s:64:"http://atmosferiq.com/wp-content/uploads/2013/12/features_12.png";s:22:"feature-description3-2";s:115:"Create unique goals to measure against your marketing spend, and determine what''s most effective for your business.";s:16:"feature-title3-3";s:19:"Complete Visibility";s:16:"feature-image3-3";s:61:"http://atmosferiq.com/wp-content/uploads/2013/12/yr_yr_15.png";s:22:"feature-description3-3";s:82:"Track performance trends over time and build a complete picture of your marketing.";s:14:"violator-title";s:24:"See Atmosferiq in Action";s:20:"violator-description";s:117:"Sign up for a webinar today and learn how Atmosferiq\r\nhelps you organize, understand, and optimize your multi-channel";s:12:"violator-btn";s:21:"Sign Up For a Webinar";}'),
