(1747, 5, 'home_page', 'a:29:{s:13:"heading-title";s:39:"MARKETING MIX MANAGEMENT FOR THE MASSES";s:19:"heading-description";s:169:"Atmosferiq helps business owners make smarter decisions, marketing managers organize multi-channel chaos, and agencies save time to foster stronger client relationships.";s:14:"violator-title";s:53:"Make Smarter Decisions by Managing Your Marketing Mix";s:20:"violator-description";s:47:"Get full access to Atmosferiq free for 30 days.";s:12:"violator-btn";s:19:"Start My Free Trial";s:16:"tradigital-title";s:19:"WHAT IS TRADIGITAL?";s:22:"tradigital-description";s:360:"Tradigital fuses traditional and digital marketing channels to create a more comprehensive understanding of customer engagement. It’s an approach for those who understand that it’s not about driving customers to a channel you want to use, it is about being able to understand which ones they want to use and correlating their use to your marketing efforts.";s:20:"tradigital-col1-stat";s:3:"84%";s:20:"tradigital-col1-desc";s:112:"The percentage of US consumers that don’t respond to Twitter. The world doesn’t revolve around social alone.";s:20:"tradigital-col1-link";s:44:"http://atmosferiq.com/the-market/tradigital/";s:20:"tradigital-col2-stat";s:3:"71%";s:20:"tradigital-col2-desc";s:130:"The percentage of ad dollars that will be spent on traditional media in 2017. It continues to be the way to reach a mass audience.";s:20:"tradigital-col2-link";s:72:"http://atmosferiq.com/the-market/money-going-sticking-traditional-media/";s:20:"tradigital-col3-stat";s:3:"50%";s:20:"tradigital-col3-desc";s:111:"The percentage of an advertising budget that’s wasted. Do you know which half of your budget is being wasted?";s:20:"tradigital-col3-link";s:66:"http://atmosferiq.com/the-market/famous-quote-history-advertising/";s:15:"violator2-title";s:24:"See Atmosferiq in Action";s:21:"violator2-description";s:127:"Sign up for a webinar today and learn how Atmosferiq helps you organize, understand, and optimize your multi-channel marketing.";s:13:"violator2-btn";s:13:"Sign Up Today";s:15:"checklist-title";s:22:"Atmosferiq at a Glance";s:14:"checklist-desc";s:125:"An easy, web-based platform to help marketers generate insights, optimize marketing spend, and improve customer engagement.\r\n";s:17:"checklist-bullet1";s:36:"Quick and Easy Channel Configuration";s:17:"checklist-bullet2";s:33:"All-in-one Multichannel Dashboard";s:17:"checklist-bullet3";s:37:"Customizable Marketing Plan and Goals";s:13:"checklist-btn";s:10:"Learn More";s:4:"docs";a:3:{i:0;a:5:{s:17:"testimonial-image";s:63:"wp-content/themes/starter-theme/images/testimonial_business.jpg";s:17:"testimonial-title";s:15:"Business Owners";s:16:"testimonial-copy";s:159:"There is 100% need for this type of tool and it should hit home to any SMB. The current time spent is a significant cost and this would save us hours per week.";s:17:"testimonial-owner";s:5:"Owner";s:17:"testimonial-place";s:13:"Jewelry Store";}i:1;a:5:{s:17:"testimonial-image";s:62:"wp-content/themes/starter-theme/images/testimonial_manager.jpg";s:17:"testimonial-title";s:18:"Marketing Managers";s:16:"testimonial-copy";s:144:"The ability to match our marketing spend versus our goals to figure out a ROI is huge for us and will fill a major gap in our marketing process.";s:17:"testimonial-owner";s:21:"Director of Marketing";s:17:"testimonial-place";s:22:"Local Automotive Group";}i:2;a:5:{s:17:"testimonial-image";s:61:"wp-content/themes/starter-theme/images/testimonial_agency.jpg";s:17:"testimonial-title";s:14:"Media Planners";s:16:"testimonial-copy";s:160:"The Dashboard alone is like discovering gold for an ad agency. We spend too much time in too many places trying to find some of this basic info for our clients.";s:17:"testimonial-owner";s:13:"Media Planner";s:17:"testimonial-place";s:18:"Advertising Agency";}}s:15:"violator3-title";s:44:"Never Get Caught Without Knowing the Whether";s:21:"violator3-description";s:35:"Start your free 30-day trial today.";s:13:"violator3-btn";s:12:"Get Started.";}'),
