(1382, 317, 'landing', 'a:13:{s:13:"landing-title";s:51:"Integrated Marketing Mix Management for Your Agency";s:19:"landing-description";s:78:"Use the time you used to spend on reports creating business-changing insights.";s:13:"landing-image";s:70:"http://atmosferiq.com/wp-content/uploads/2013/11/atmosferiq_filler.png";s:17:"landing-copy-desc";s:406:"Atmosferiq provides agencies a single platform to track and manage every channel for every client, removing hours of work in synthesizing and reporting to give marketers the time they need to study activity and provide actionable insights. Our tools aggregate multi-channel marketing into a customer dashboard and intuitive timeline view to give marketers in-depth, up-to-date customer engagement activity.";s:22:"landing-bullet-header1";s:36:"Manage All Your Clients in One Place";s:20:"landing-bullet-desc1";s:109:"Efficiently view and manage the online and offline marketing activity of every client from a single account.";s:22:"landing-bullet-header2";s:32:"Collaborate to Increase Insights";s:20:"landing-bullet-desc2";s:163:"Create additional accounts with flexiblepermissions to easily share insights with andand collect additional information from clientsand other channel resources.";s:22:"landing-bullet-header3";s:16:"Help Us Help You";s:20:"landing-bullet-desc3";s:128:"As an Atmosferiq agency partner, utilize exclusive incentives and resources to build a scalable,predictable source of business.";s:19:"landing-form-header";s:63:"Be the first to get access when we launch first quarter of 2014";s:22:"landing-form-shortcode";s:81:"[gravityform id="4" name="Contact" title="false" description="false" ajax="true"]";s:19:"landing-form-button";s:9:"Notify Me";}'),
