(20, 1, '2013-11-17 22:51:18', '2013-11-17 22:51:18', 'Atmosferiq provides agencies a single platform to track and manage every channel for every client, eliminating hours of work in synthesizing and reporting so that marketers can focus on what''s really essential - studying activity and providing actionable insights. Our tools aggregate multi-channel marketing into a customer dashboard and intuitive timeline view to give marketers in-depth, up-to-date customer engagement activity.', 'Agencies', 'All marketing and advertising agencies are under pressure to stay current on the ever-evolving landscape of customer engagement, while still finding time to manage the existing plan and activities.', 'publish', 'open', 'closed', '', 'agencies', '', '', '2014-05-11 16:11:11', '2014-05-11 16:11:11', '', 0, 'http://atmosferiq.thinktiv.webfactional.com/?page_id=20', 0, 'page', '', 0),
