(67, 1, '2013-12-12 22:17:16', '2013-12-12 22:17:16', 'We make it possible for marketers to analyze the effectiveness of their marketing activities by providing a single, comprehensive dashboard to view and understand online and offline customer engagement. By integrating digital and traditional marketing channels into a single dashboard, marketers can see the activation of any marketing activity across all channels, not just the one they published through. As a result, marketers can make more informed decisions about where and when to make advertising buys and plan more effective multi-channel campaigns.', 'For Marketing Managers', 'Your customer lives in a multi-channel world, and connecting with them on a lean budget and an endless assortment of engagement tools can be near-impossible.', 'inherit', 'open', 'open', '', '55-autosave-v1', '', '', '2013-12-12 22:17:16', '2013-12-12 22:17:16', '', 55, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/55-autosave-v1/', 0, 'revision', '', 0),
