(52, 1, '2013-11-19 16:04:53', '2013-11-19 16:04:53', 'We give owners high-level visibility into their marketing, helping them to plan within their marketing budget, eliminate reactionary or ineffective spending, and create more targeted customer converting marketing campaigns. And with an ever-growing collection of supported marketing channels, we’ll help business owners identify, understand, and plan for new marketing opportunities.', 'Business Owners', 'Business owners are always on the go. They often manage all parts of their business on the fly, leaving little time to focus on the complex and ever-changing opportunities in marketing.', 'publish', 'open', 'open', '', 'business-owners', '', '', '2014-05-11 16:08:50', '2014-05-11 16:08:50', '', 0, 'http://atmosferiq.thinktiv.webfactional.com/?page_id=52', 0, 'page', '', 0),
