(200, 2, '2013-11-15 20:47:38', '2013-11-15 20:47:38', '<p dir="ltr">If I said the name John Wanamaker to you, you''d probably just give a blank stare. That''s ok...he''s been dead for 91 years. John was a retail baron in the 1800s when newspaper was pretty much the only form of formal advertising. Even with so few ways in which to attract customers, he said "Half the money I spend on advertising is wasted; the trouble is I don''t know which half." I''m sure anyone in the field has heard this famous quote and may have even heard it recently as it still rings true.</p>\r\nThe bottom line is that it’s hard to really understand what works...especially when your business is a physical space, not a cyber store. It takes time, patience, focus, and flexibility to get to a plan that works and is repeatable for as long as possible. It will need to change at some point, so better to be prepared to know when that change is coming and where resources need to be shifted next.\r\n\r\nJohn Wanamaker understood this and it is why he was one of of the most successful businessmen of his era. If you can think like John...maybe you can be a baron someday too.', 'The Most Famous Quote in the History of Advertising', '', 'publish', 'open', 'open', '', 'famous-quote-history-advertising', '', '', '2014-01-22 16:40:59', '2014-01-22 16:40:59', '', 0, 'http://atmosferiq.thinktiv.webfactional.com/?p=200', 0, 'post', '', 0),
