(116, 1, '2013-11-30 15:57:06', '2013-11-30 15:57:06', 'We’ve built Atmosferiq to bring the precision of digital analytics to your offline campaigns. By integrating your digital and analog marketing channels into a single platform, you can track the return on every campaign, learn where and when to make advertising buys, and plan more effective multi-channel campaigns. Digital advertising may dominate the industry, but that doesn’t mean your customers are along for the ride. Go where you’ll be heard, and always know the whether.', 'For Marketing Managers', 'For modern small-business marketers, trying to manage both online and offline channels—all within the constraints of your marketing budget—is enough to make you tear your hair out.', 'inherit', 'open', 'open', '', '55-revision-v1', '', '', '2013-11-30 15:57:06', '2013-11-30 15:57:06', '', 55, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/55-revision-v1/', 0, 'revision', '', 0),
