(109, 1, '2013-11-26 02:38:32', '2013-11-26 02:38:32', 'We’ve built Atmosferiq to help you to eliminate reactionary spending and create more targeted, effective marketing campaigns. By giving you full visibility into all of your marketing channels, you’ll know at a glance which channels best speak to your customer base, and where to focus your resources. At the end of the day, its your job to run your business; it’s our job to help you grow it.', 'Business Owners', 'As a business owner, you never stop working, and with the 25th hour of your day, the last thing you need to do is make an impulsive marketing decision.', 'inherit', 'open', 'open', '', '52-revision-v1', '', '', '2013-11-26 02:38:32', '2013-11-26 02:38:32', '', 52, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/52-revision-v1/', 0, 'revision', '', 0),
