(156, 2, '2013-12-04 16:26:27', '2013-12-04 16:26:27', '<p dir="ltr">A <a href="http://www.biakelsey.com/Company/Press-Releases/131119-Overall-U.S.-Local-Media-Ad-Revenues-to-Reach-$151.5B-in-2017.asp">BIA/Kelsey forecast</a> suggests that while digital media revenues will see growth over the next several years in the local ad space, it’s certainly not taking over the world as some might think. One word may suggest why traditional media will still take in 70% of the dollars spent by 2017, and that word is <span style="text-decoration: underline;"><strong>LOCAL</strong></span>.</p>\r\n<p dir="ltr">Local businesses don’t exclusively exist in the world of “click here and buy me now”. They’re real places with real people that you can build a real relationship with.</p>\r\n<p dir="ltr">So why will traditional media such as TV, Radio, Print &amp; Billboards continue to attract the local dollars? Because they too are real. These are tangible things that people can interact with via sight, sound, motion and emotion. They effectively build the story so that when a customer is at the point where they intend to buy your product or service, you are top of mind.</p>\r\n<p dir="ltr">Traditional media is the only way you can have a mass audience learn about your business. Only then do they go elsewhere to get more information about you:  Yellow Pages or Google for your phone &amp; address; Facebook to ask friends about your; or Yelp to read a review from someone they don’t necessarily know or trust. These things only happen when someone is aware of you. The other channels will become active as both need, interest, and intent increase.</p>\r\nAll channels have their place when communicating to the market...you just need to know what is needed, when and where.', 'Where the money is going...and why it''s sticking with traditional media', '', 'inherit', 'open', 'open', '', '152-revision-v1', '', '', '2013-12-04 16:26:27', '2013-12-04 16:26:27', '', 152, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/152-revision-v1/', 0, 'revision', '', 0),
