ney is going...and why it''s sticking with traditional media', '', 'inherit', 'open', 'open', '', '152-revision-v1', '', '', '2013-12-04 16:30:23', '2013-12-04 16:30:23', '', 152, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/152-revision-v1/', 0, 'revision', '', 0),
