(161, 2, '2013-12-04 22:58:34', '2013-12-04 22:58:34', 'If you answered "NO", then it''s time to get on board.\r\n\r\nSo what is "Tradigital"? In this day in age, you''ve got so many ways to communicate with your audience, whether it be the traditional staples such as television, radio, and print or the vast vast array of digital options via email, social, etc. The reality is, you need to use most, if not all, to be effective. And you need to use them constantly as they allow you to be a 24 x 7 x 365 business. You also need to be consistent and have a cohesive message across the multiple channels, because when your radio ad is heard, someone if going to likely go online to find out more so you want to ensure your message is the  same to keep them engaged and moving closer to becoming a customer. If the right hand doesn''t know what the left is doing, you''re ultimately losing out on business.\r\n\r\nAtmosferiq is built for those businesses who already have transformed to tradigital, and for those who need to get there. I''ll be honest...going tradigital is hard. We exist to make it easier and quicker. It takes time and commitment. But once you get there, you''ll never look back.', 'Are you Tradigital?', '', 'publish', 'open', 'open', '', 'tradigital', '', '', '2014-01-25 22:13:16', '2014-01-25 22:13:16', '', 0, 'http://atmosferiq.thinktiv.webfactional.com/?p=161', 0, 'post', '', 1),
