(208, 1, '2013-12-06 21:42:30', '2013-12-06 21:42:30', 'We’ve built Atmosferiq to integrate online and offline channels into one tool to let marketers test insights, not manage multiple analytics platforms. By integrating your digital and analog marketing channels into a single platform, you can track the return on every campaign, learn where and when to make advertising buys, and plan more effective multi-channel campaigns. Digital advertising may dominate the industry, but that doesn’t mean your customers are along for the ride. Go where you’ll be heard, and always know the whether.\r\n\r\n', 'For Marketing Managers', 'With the constantly increasing number of channels and engagement opportunities, trying to manage both offline and online channels within a confined budget is extremely difficult.', 'inherit', 'open', 'open', '', '55-revision-v1', '', '', '2013-12-06 21:42:30', '2013-12-06 21:42:30', '', 55, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/55-revision-v1/', 0, 'revision', '', 0),
(207, 1, '2013-12-06 21:41:07', '2013-12-06 21:41:07', 'We’ve built Atmosferiq to bring the precision of digital analytics to your offline campaigns. By integrating your digital and analog marketing channels into a single platform, you can track the return on every campaign, learn where and when to make advertising buys, and plan more effective multi-channel campaigns. Digital advertising may dominate the industry, but that doesn’t mean your customers are along for the ride. Go where you’ll be heard, and always know the whether.\r\n\r\n', 'For Marketing Managers', 'With the constantly increasing number of channels and engagement opportunities, trying to manage both offline and online channels within a confined budget is extremely difficult.', 'inherit', 'open', 'open', '', '55-revision-v1', '', '', '2013-12-06 21:41:07', '2013-12-06 21:41:07', '', 55, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/55-revision-v1/', 0, 'revision', '', 0),
