(202, 2, '2013-12-06 20:49:29', '2013-12-06 20:49:29', '<p dir="ltr">If I said the name John Wanamaker to you, you''d probably just give a blank stare. That''s ok...he''s been dead for 91 years. John was a retail baron in the 1800s when newspaper was pretty much the only form of formal advertising. Even with so few ways in which to attract customers, he said "Half the money I spend on advertising is wasted; the trouble is I don''t know which half." I''m sure anyone in the field has heard this famous quote and may have even heard it recently has it still rings true for so many people.</p>\r\nThe bottom line is that it’s hard to really understand what works...especially when your business is a physical space, not a cyber store. It takes time, patience, focus, and flexibility to get to a plan that works and is repeatable for as long as possible. It will need to change at some point, so better to be prepared to know when that change is coming and where resources need to be shifted next.', 'The Most Famous Quote in the History of Advertising', '', 'inherit', 'open', 'open', '', '200-revision-v1', '', '', '2013-12-06 20:49:29', '2013-12-06 20:49:29', '', 200, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/200-revision-v1/', 0, 'revision', '', 0),
(203, 2, '2013-12-06 20:52:55', '2013-12-06 20:52:55', '<p dir="ltr">If I said the name John Wanamaker to you, you''d probably just give a blank stare. That''s ok...he''s been dead for 91 years. John was a retail baron in the 1800s when newspaper was pretty much the only form of formal advertising. Even with so few ways in which to attract customers, he said "Half the money I spend on advertising is wasted; the trouble is I don''t know which half." I''m sure anyone in the field has heard this famous quote and may have even heard it recently as it still rings true.</p>\r\nThe bottom line is that it’s hard to really understand what works...especially when your business is a physical space, not a cyber store. It takes time, patience, focus, and flexibility to get to a plan that works and is repeatable for as long as possible. It will need to change at some point, so better to be prepared to know when that change is coming and where resources need to be shifted next.\r\n\r\nJohn Wanamaker understood this and it is why he was one of of the most successful businessmen of his era. If you can think like John...maybe you can be a baron someday too.', 'The Most Famous Quote in the History of Advertising', '', 'inherit', 'open', 'open', '', '200-revision-v1', '', '', '2013-12-06 20:52:55', '2013-12-06 20:52:55', '', 200, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/200-revision-v1/', 0, 'revision', '', 0),
(205, 2, '2013-12-09 21:01:29', '2013-12-09 21:01:29', 'If you answered "NO", then it''s time to get on board.\n\nSo what is "Tradigital"? In this day in age, you''ve got so many ways to communicate with your audience, whether it be the traditional staples such as television, radio, and print or the vast vast array of digital options via email, social, etc. The reality is, you need to use most, if not all, to be effective. And you need to use them constantly as they allow you to be a 24 x 7 x 365 business. You also need to be consistent and have a cohesive message across the multiple channels, because when your radio ad is heard, someone if going to likely go online to find out more so you want to ensure your message is the  same to keep them engaged and moving closer to becoming a customer. If the right hand doesn''t know what the left is doing, you''re ultimately losing out on business.\n\nAtmosferiq is built for those businesses who already have transformed to tradigital, and for those who need to get there. I''ll be honest...going tradigital is hard. We''re here to makIt takes time and commitment. But once you get there, you''ll never look back.\n\n&nbsp;\n\n&nbsp;', 'Are you Tradigital?', '', 'inherit', 'open', 'open', '', '161-autosave-v1', '', '', '2013-12-09 21:01:29', '2013-12-09 21:01:29', '', 161, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/161-autosave-v1/', 0, 'revision', '', 0),
(209, 1, '2014-05-08 22:50:35', '2014-05-08 22:50:35', 'We give owners high-level visibility into their marketing, helping them to plan within their marketing budget, eliminate reactionary or ineffective spending, and create more targeted customer converting marketing campaigns. And with an ever-growing collection of supported marketing channels, we’ll help business owners identify, understand, and plan for new marketing opportunities.', 'Business Owners', '', 'inherit', 'open', 'open', '', '52-autosave-v1', '', '', '2014-05-08 22:50:35', '2014-05-08 22:50:35', '', 52, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/52-autosave-v1/', 0, 'revision', '', 0),
(282, 1, '2013-12-12 22:10:44', '2013-12-12 22:10:44', 'We give owners high-level visibility into their marketing, helping them to plan within their marketing budget, eliminate reactionary or ineffective spending, and create more targeted customer converting marketing campaigns. And with an ever-growing collection of supported marketing channels, we’ll help business owners identify, understand, and plan for new marketing opportunities.', 'Business Owners', 'Small and medium-sized business owners are always on the go. They often managing all parts of their business on the fly, leaving little time to focus on the complex and ever-changing opportunities in marketing.', 'inherit', 'open', 'open', '', '52-revision-v1', '', '', '2013-12-12 22:10:44', '2013-12-12 22:10:44', '', 52, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/52-revision-v1/', 0, 'revision', '', 0),
(210, 1, '2013-12-09 11:05:39', '2013-12-09 11:05:39', 'We help owners get dashboard level visibility into the to typical marketing activities of their business to help plan and control spending, eliminate reactionary spending, and create more targeted, effective, customer converting marketing campaigns. And with a constantly growing collection of supported marketing channels, we help the business owner find, understand and plan for new marketing opportunities that may be a fit for the business.', 'Business Owners', 'Small and medium-sized business owners are always on the go and often managing all parts of their business on the fly with little time to focus on the complex and ever-changing opportunities in marketing.', 'inherit', 'open', 'open', '', '52-revision-v1', '', '', '2013-12-09 11:05:39', '2013-12-09 11:05:39', '', 52, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/52-revision-v1/', 0, 'revision', '', 0),
(284, 1, '2013-12-12 22:15:37', '2013-12-12 22:15:37', 'We make it possible for marketers to analyze the effectiveness of their comprehensive marketing activities by providing one single dashboard to view and understand online and offline customer engagement. By integrating digital and traditional marketing channels into a single dashboard, marketers can see the the activation of any marketing activity across all channels, not just the one they published through. As a result, marketers can make more informed decisions about where and when to make advertising buys and plan more effective multi-channel campaigns.', 'For Marketing Managers', 'Your customer lives in a multi-channel world. Connecting with them on a lean budget and an endless assortment of engagement tools can be near-impossible.', 'inherit', 'open', 'open', '', '55-revision-v1', '', '', '2013-12-12 22:15:37', '2013-12-12 22:15:37', '', 55, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/55-revision-v1/', 0, 'revision', '', 0),
