(212, 1, '2013-12-09 11:11:02', '2013-12-09 11:11:02', 'Atmosferiq provides agencies a single platform to track and manage every channel for every client—removing hours of work in synthesizing and reporting to give marketers the time they need to study activity and provide actionable insights. Our tools synthesize multi-channel marketing into a customer dashboard and intuitive multi-channel timeline view to give marketers in-depth, up-to-date customer engagement activity.', 'For Agencies', 'All marketing and advertising agencies are under pressure to stay current on the ever-evolving landscape of customer engagement while still finding time to manage the existing plan and activities.', 'inherit', 'open', 'open', '', '20-autosave-v1', '', '', '2013-12-09 11:11:02', '2013-12-09 11:11:02', '', 20, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/20-autosave-v1/', 0, 'revision', '', 0),
