(218, 2, '2013-11-07 21:10:40', '2013-11-07 21:10:40', '<p dir="ltr">Ten years ago you could probably count on one hand the number of channels you needed to use to effectively market to your customers. These days, you’ve probably got all ten fingers covered and are well into using your toes to keep count.</p>\r\n<p dir="ltr">What likely hasn’t changed is the amount of money you have available to spend: the pie ain’t getting much bigger. More than even you need to understand where you should be investing your dollars on an ongoing basis and always keep yourself in a position to move them around and take advantage of new channels when appropriate.</p>\r\n<p dir="ltr"><img class="size-full wp-image-221 alignleft" alt="homer pie" src="http://atmosferiq.com/wp-content/uploads/2013/11/homer-pie.jpeg" width="259" height="194" /></p>\r\n<p dir="ltr">Just like Homer Simpson, Atmosferiq loves us some pie. We hope you do too as there''s a whole lot of pie out there to eat.</p>', 'The pie isn''t getting any bigger. There''s just more pieces to eat.', '', 'publish', 'open', 'open', '', 'pie-isnt-bigger-theres-just-pieces-eat', '', '', '2014-01-25 22:25:20', '2014-01-25 22:25:20', '', 0, 'http://atmosferiq.thinktiv.webfactional.com/?p=218', 0, 'post', '', 0),
