(278, 1, '2013-12-12 21:33:25', '2013-12-12 21:33:25', '<h1>Marketing Mix Management Software</h1>\r\nAtmosferiq helps business owners make smarter decisions, removes the chaos of channel management for marketing managers, and gives agencies time to focus on insights.', 'Software', '', 'inherit', 'open', 'open', '', '9-revision-v1', '', '', '2013-12-12 21:33:25', '2013-12-12 21:33:25', '', 9, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/9-revision-v1/', 0, 'revision', '', 0),
(280, 1, '2013-12-12 22:01:03', '2013-12-12 22:01:03', '', 'For Businesses', '', 'publish', 'open', 'open', '', '280', '', '', '2014-05-08 21:46:46', '2014-05-08 21:46:46', '', 0, 'http://atmosferiq.thinktiv.webfactional.com/?p=280', 1, 'nav_menu_item', '', 0),
(283, 1, '2013-12-12 22:13:18', '2013-12-12 22:13:18', 'We give owners high-level visibility into their marketing, helping them to plan within their marketing budget, eliminate reactionary or ineffective spending, and create more targeted customer converting marketing campaigns. And with an ever-growing collection of supported marketing channels, we’ll help business owners identify, understand, and plan for new marketing opportunities.', 'Business Owners', 'Business owners are always on the go. They often managing all parts of their business on the fly, leaving little time to focus on the complex and ever-changing opportunities in marketing.', 'inherit', 'open', 'open', '', '52-revision-v1', '', '', '2013-12-12 22:13:18', '2013-12-12 22:13:18', '', 52, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/52-revision-v1/', 0, 'revision', '', 0),
(285, 1, '2013-12-12 22:16:14', '2013-12-12 22:16:14', 'We make it possible for marketers to analyze the effectiveness of their comprehensive marketing activities by providing one single dashboard to view and understand online and offline customer engagement. By integrating digital and traditional marketing channels into a single dashboard, marketers can see the the activation of any marketing activity across all channels, not just the one they published through. As a result, marketers can make more informed decisions about where and when to make advertising buys and plan more effective multi-channel campaigns.', 'For Marketing Managers', 'Your customer lives in a multi-channel world, and connecting with them on a lean budget and an endless assortment of engagement tools can be near-impossible.', 'inherit', 'open', 'open', '', '55-revision-v1', '', '', '2013-12-12 22:16:14', '2013-12-12 22:16:14', '', 55, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/55-revision-v1/', 0, 'revision', '', 0),
(286, 1, '2013-12-12 22:18:18', '2013-12-12 22:18:18', 'We make it possible for marketers to analyze the effectiveness of their marketing activities by providing a single, comprehensive dashboard to view and understand online and offline customer engagement. By integrating digital and traditional marketing channels into a single dashboard, marketers can see the activation of any marketing activity across all channels, not just the one they published through. As a result, marketers can make more informed decisions about where and when to make advertising buys and plan more effective multi-channel campaigns.', 'For Marketing Managers', 'Your customer lives in a multi-channel world, and connecting with them on a lean budget and an endless assortment of engagement tools can be near-impossible.', 'inherit', 'open', 'open', '', '55-revision-v1', '', '', '2013-12-12 22:18:18', '2013-12-12 22:18:18', '', 55, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/55-revision-v1/', 0, 'revision', '', 0),
