(288, 1, '2013-12-12 22:29:08', '2013-12-12 22:29:08', 'Atmosferiq provides agencies a single platform to track and manage every channel for every client—removing hours of work in synthesizing and reporting to give marketers the time they need to study activity and provide actionable insights. Our tools aggregate multi-channel marketing into a customer dashboard and intuitive timeline view to give marketers in-depth, up-to-date customer engagement activity.', 'For Agencies', 'All marketing and advertising agencies are under pressure to stay current on the ever-evolving landscape of customer engagement, while still finding time to manage the existing plan and activities.', 'inherit', 'open', 'open', '', '20-revision-v1', '', '', '2013-12-12 22:29:08', '2013-12-12 22:29:08', '', 20, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/20-revision-v1/', 0, 'revision', '', 0),
(354, 2, '2014-02-03 16:50:38', '2014-02-03 16:50:38', 'Atmosferiq provides agencies a single platform to track and manage every channel for every client, eliminating hours of work in synthesizing and reporting so that marketers can focus on w. Our tools aggregate multi-channel marketing into a customer dashboard and intuitive timeline view to give marketers in-depth, up-to-date customer engagement activity.', 'Agencies', 'All marketing and advertising agencies are under pressure to stay current on the ever-evolving landscape of customer engagement, while still finding time to manage the existing plan and activities.', 'inherit', 'open', 'open', '', '20-autosave-v1', '', '', '2014-02-03 16:50:38', '2014-02-03 16:50:38', '', 20, 'http://atmosferiq.com/uncategorized/20-autosave-v1/', 0, 'revision', '', 0),
(299, 1, '2013-12-30 01:40:47', '2013-12-30 01:40:47', 'Atmosferiq provides agencies a single platform to track and manage every channel for every client, removing hours of work in synthesizing and reporting to give marketers the time they need to study activity and provide actionable insights. Our tools aggregate multi-channel marketing into a customer dashboard and intuitive timeline view to give marketers in-depth, up-to-date customer engagement activity.', 'Agencies', 'All marketing and advertising agencies are under pressure to stay current on the ever-evolving landscape of customer engagement, while still finding time to manage the existing plan and activities.', 'inherit', 'open', 'open', '', '20-revision-v1', '', '', '2013-12-30 01:40:47', '2013-12-30 01:40:47', '', 20, 'http://atmosferiq.com/uncategorized/20-revision-v1/', 0, 'revision', '', 0),
(301, 2, '2014-01-07 16:30:17', '2014-01-07 16:30:17', 'According to an article in <a href="http://digiday.com/platforms/twitter-contemplates-entering-local-ad-market/">Digiday</a>, it looks like Twitter is attempting to make a play in the local ad market, via a new Feature called Nearby. Add this to the list of tools like Foursquare, Facebook, Groupon and Yelp trying to get more of your marketing dollars.\r\n\r\nTime will tell whether this ultimately replaces a service like Foursquare as some speculate, or it will be just an additional tool a business uses to speak to very fragmented audiences that exist in all of these digital "places".\r\n\r\nThe end goal is to target very specific people based on demographic data and interests, but can anyone quantify if the user cares about what you have to say? Instead of asking "what does this mean for my business?", maybe we should ask "what does this mean for my customers?" Are they paying attention to ads in their feeds? Can I give a compelling enough reason for them to come into my business? Will this push them away from the platform they enjoy so much without being served ads?\r\n\r\nTwitter is certainly a viable tool for many businesses and Nearby has the potential to add value, but it''s not for every business. You just need to decide and constantly evaluate what''s right for your business.', 'Twitter coming to a town near you?', '', 'publish', 'open', 'open', '', 'twitter-coming-town-near', '', '', '2014-01-22 16:45:19', '2014-01-22 16:45:19', '', 0, 'http://atmosferiq.com/?p=301', 0, 'post', '', 0);
