(302, 2, '2014-01-07 16:30:01', '2014-01-07 16:30:01', 'According to an article in <a href="http://digiday.com/platforms/twitter-contemplates-entering-local-ad-market/">Digiday</a>, it looks like Twitter is attempting to make a play in the local ad market, via a new Feature called Nearby. Add this to the list of tools like Foursquare, Facebook, Groupon and Yelp trying to get more of your marketing dollars.\r\n\r\nTime will tell whether this ultimately replaces a service like Foursquare as some speculate, or it will be just an additional tool a business uses to speak to very fragmented audiences that exist in all of these digital "places".\r\n\r\nThe end goal is to target very specific people based on demographic data and interests, but can anyone quantify if the user cares about what you have to say? Instead of asking "what does this mean for my business?", maybe we should ask "what does this mean for my customers?" Are they paying attention to ads in their feeds? Can I give a compelling enough reason for them to come into my business? Will this push them away from the platform they enjoy so much without being served ads?\r\n\r\nTwitter is certainly a viable tool for many businesses and Nearby has the potential to add value, but it''s not for every business. You just need to decide and constantly evaluate what''s right for your business.\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'Twitter coming to a town near you?', '', 'inherit', 'open', 'open', '', '301-revision-v1', '', '', '2014-01-07 16:30:01', '2014-01-07 16:30:01', '', 301, 'http://atmosferiq.com/uncategorized/301-revision-v1/', 0, 'revision', '', 0),
(304, 2, '2014-01-15 19:34:01', '2014-01-15 19:34:01', 'You''ve probably heard the news by now:  traditional media is dead. Yes, numbers are down from newspaper readership to television viewing so that most certainly must mean it''s dead.\r\n\r\nWe beg to differ.\r\n\r\nDigital and social media pundits will shout this story from the rooftops, but that doesn''t make it true. Digital marketing absolutely has its place in an ad campaign, and we would even suggest that every campaign have a digital component; because customers go online to learn more about you (location, phone, reviews) after they''ve already become aware of you. Without traditional media channels such as broadcast &amp; cable TV, radio, print, and other offline channels at the forefront of your marketing, the activity on your digital channels will be limited because you''re not making a mass audience aware of your existence and value.\r\n\r\nAt the end of the day it''s all about your managing your <a href="http://atmosferiq.com/" target="_blank">marketing mix</a>. There''s an unprecedented and overwhelming number of choices available today to reach potential customers, and there will be a new mouse trap next week, next month, and on and on. The key is to pick the right channels, be consistent, and understand their relationship with each other. It''s not a question of either/or. <a href="http://atmosferiq.com/software/" target="_blank">Traditional and digital need each other to be their best</a>.', 'Why Traditional Media is the Gateway to Digital', '', 'publish', 'open', 'open', '', 'traditional-media-gateway-digital', '', '', '2014-01-25 22:32:42', '2014-01-25 22:32:42', '', 0, 'http://atmosferiq.com/?p=304', 0, 'post', '', 0),
