(330, 1, '2014-01-23 15:14:04', '2014-01-23 15:14:04', '<h2 dir="ltr">Traditional Media is Dead</h2>\r\n<p dir="ltr">We’re sure you’ve heard the news by new: <a href="http://searchenginewatch.com/article/2052169/Ballmer-Sees-Traditional-Media-As-Dead-Men-Walking">traditional media is dead.</a> Or <a href="http://www.mpoweringu.com/traditional-media-marketing-is-not-dead-it%E2%80%99s-just-dying/">dying</a>, at least. Yes, numbers are down across the board. The Pew center says newspaper readership <a href="http://stateofthemedia.org/2013/newspapers-stabilizing-but-still-threatened/newspapers-by-the-numbers/">has been declining steadily</a> over the past eight years, with 2013 advertising revenue numbers just under half what they were in 2006. Broadcast television is in the same boat, with audience ratings <a href="http://www.businessinsider.com/brutal-50-decline-in-tv-viewership-shows-why-your-cable-bill-is-so-high-2013-1">diminishing by 50% since 2002</a>.</p>\r\n<p dir="ltr">Even a late-2010 poll by 24/7 Wall St./Harris Poll found that <a href="http://view.sales.harrisinteractive.com/?j=fe5d1675746600787d13&amp;m=fef51674726302&amp;ls=fdcb1570766d027f7115717c64&amp;l=fe671577756004757114&amp;s=fe271679706c077c7d1474&amp;jb=ffcf14&amp;ju=fe2116787c640175721271">over half of Americans</a> believe traditional media as we currently know it will no longer exist in ten years. Given that, it’s safe to say that you shouldn’t market your business in traditional media channels, right?</p>\r\n\r\n<h2 dir="ltr">Digital Marketing isn’t the Only Answer Either</h2>\r\n<p dir="ltr">If traditional media is dead, it stands to reason you should focus your energy on digital channels like Twitter and Facebook. Except that <a href="http://www.journalism.org/2013/11/04/twitter-news-consumers-young-mobile-and-educated/">84% of US consumers don’t use Twitter</a>. Facebook, meanwhile, is experiencing <a href="http://www.nydailynews.com/life-style/elderly-people-social-media-article-1.1418755">experiencing a rapid generational shift</a>, and has been <a href="http://www.nydailynews.com/life-style/facebook-losing-young-people-article-1.1502879">shedding users regardless since 2012</a>. With <a href="http://fstoppers.com/the-decline-of-facebook-explained">recent exposés on Facebook’s organic-reach practices</a>, that number is sure to continue falling. That leaves channels like Pinterest and Instagram, each of which appeal to specific demographics, but how do you determine if those users will listen to what you have to say?</p>\r\n\r\n<h2 dir="ltr">What Matters is the Marketing Mix</h2>\r\n<p dir="ltr">The marketing landscape is changing more rapidly now than ever before, and there is no longer a silver-bullet solution to get your business noticed. There will always be another new platform to consider, and there will always be another frenzied marketing thinkpiece telling you what’s hot, what’s dying, and where to spend your time and effort.</p>\r\n<p dir="ltr">None of that matters.</p>\r\n<p dir="ltr">What does matter is where your customers are, and where they want to be engaged. That could mean all of your marketing is traditional, or all of your marketing is digital. More than likely, though, your business lives at an intersection of those two worlds, and that can be a confusing place.</p>\r\n<p dir="ltr">As a marketer, you need to be able to quickly, accurately measure the reach of any campaign, and gauge how efforts in one channel effect another. With that data, you can assess what channels yield the highest ROI, and spend your time optimizing those channels to create a perfect marketing mix.</p>\r\n<p dir="ltr">Identifying your mix means you don’t have to worry about marketing trend pieces and what they could mean for your business. You’ll know what channels reach your customers, and if you do explore a new channel, you’ll have a statistical baseline you can use to gauge effectiveness.</p>\r\n<p dir="ltr">Does your business live at the intersection of traditional and digital media? How did you decide what channels are best for your business?</p>', 'The Marketing Mix that Matters: How to Live at the Intersection of Traditional and Digital Channels', '', 'draft', 'open', 'open', '', 'the-marketing-mix-that-matters', '', '', '2014-01-25 22:08:17', '2014-01-25 22:08:17', '', 0, 'http://atmosferiq.thinktiv.webfactional.com/?p=330', 0, 'post', '', 0),
