(319, 1, '2014-01-20 17:08:56', '2014-01-20 17:08:56', 'Atmosferiq provides agencies a single platform to track and manage every channel for every client, removing hours of work in synthesizing and reporting to give marketers the time they need to study activity and provide actionable insights. Our tools aggregate multi-channel marketing into a customer dashboard and intuitive timeline view to give marketers in-depth, up-to-date customer engagement activity.', 'Landing Page', '', 'inherit', 'open', 'open', '', '317-autosave-v1', '', '', '2014-01-20 17:08:56', '2014-01-20 17:08:56', '', 317, 'http://localhost:8888/atmosferiq/uncategorized/317-autosave-v1/', 0, 'revision', '', 0),
(322, 1, '2014-01-21 19:42:10', '2014-01-21 19:42:10', '<p dir="ltr">10 years ago you could probably count on one hand the number of channels you needed to use to effectively market to your customers. These days, you’ve probably got all ten fingers covered and are well into using your toes to keep count.</p>\r\n<p dir="ltr">What likely hasn’t changed is the amount of money you have available to spend: the pie ain’t getting much bigger. More than even you need to understand where you should be investing your dollars on an ongoing basis and always keep yourself in a position to move them around and take advantage of new channels when appropriate.</p>\r\n<p dir="ltr"><a href="http://atmosferiq.com/wp-content/uploads/2013/11/homer-pie.jpeg"><img class="size-full wp-image-221 alignleft" alt="homer pie" src="http://atmosferiq.com/wp-content/uploads/2013/11/homer-pie.jpeg" width="259" height="194" /></a></p>\r\n<p dir="ltr">Just like Homer Simpson, Atmosferiq loves us some pie. We hope you do too as there''s a whole lot of pie out there to eat.</p>', 'The pie isn''t getting any bigger. There''s just more pieces to eat.', '', 'inherit', 'open', 'open', '', '218-revision-v1', '', '', '2014-01-21 19:42:10', '2014-01-21 19:42:10', '', 218, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/218-revision-v1/', 0, 'revision', '', 0),
