(324, 1, '2014-01-22 16:35:32', '2014-01-22 16:35:32', '', 'Is Twitter''s Nearby coming to your town?', '', 'inherit', 'open', 'open', '', 'atmosferiq_twitter', '', '', '2014-01-22 16:35:32', '2014-01-22 16:35:32', '', 301, 'http://atmosferiq.thinktiv.webfactional.com/wp-content/uploads/2014/01/atmosferiq_twitter.png', 0, 'attachment', 'image/png', 0),
(326, 1, '2014-01-22 16:45:19', '2014-01-22 16:45:19', 'According to an article in <a href="http://digiday.com/platforms/twitter-contemplates-entering-local-ad-market/">Digiday</a>, it looks like Twitter is attempting to make a play in the local ad market, via a new Feature called Nearby. Add this to the list of tools like Foursquare, Facebook, Groupon and Yelp trying to get more of your marketing dollars.\r\n\r\nTime will tell whether this ultimately replaces a service like Foursquare as some speculate, or it will be just an additional tool a business uses to speak to very fragmented audiences that exist in all of these digital "places".\r\n\r\nThe end goal is to target very specific people based on demographic data and interests, but can anyone quantify if the user cares about what you have to say? Instead of asking "what does this mean for my business?", maybe we should ask "what does this mean for my customers?" Are they paying attention to ads in their feeds? Can I give a compelling enough reason for them to come into my business? Will this push them away from the platform they enjoy so much without being served ads?\r\n\r\nTwitter is certainly a viable tool for many businesses and Nearby has the potential to add value, but it''s not for every business. You just need to decide and constantly evaluate what''s right for your business.', 'Twitter coming to a town near you?', '', 'inherit', 'open', 'open', '', '301-revision-v1', '', '', '2014-01-22 16:45:19', '2014-01-22 16:45:19', '', 301, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/301-revision-v1/', 0, 'revision', '', 0),
(360, 1, '2014-03-08 23:50:37', '2014-03-08 23:50:37', '<div class="career">\r\n<h2 dir="ltr" id="software-developer">Software Developer</h2>\r\n<p dir="ltr">Atmosferiq is a startup. We build stuff fast...we make mistakes...we learn...we repeat.  If you’ve worked in this kind of environment before, you get it. If you want work in this kind of environment, you’ll pick it up quickly.</p>\r\n<p dir="ltr">Atmosferiq is a marketing management tool designed specifically for local small businesses and marketing agencies to organize and understand the chaos of all of their marketing channels, both online &amp; offline. Our goal is to help give greater visibility to the entire marketing portfolio so they know whether it’s working and can make smarter decisions on the fly.</p>\r\n\r\n<h3 dir="ltr">Stuff You Should Know:</h3>\r\n<ul>\r\n	<li dir="ltr">\r\n<p dir="ltr"><a href="https://www.ruby-lang.org/en/">Ruby</a> or <a href="http://rubyonrails.org/">Rails</a>.</p>\r\n</li>\r\n	<li dir="ltr">\r\n<p dir="ltr">HTML5, CSS3, <a href="http://jquery.com/">JQuery</a>, &amp; <a href="http://getbootstrap.com/">Twitter Bootstrap</a></p>\r\n</li>\r\n	<li dir="ltr">\r\n<p dir="ltr">Software development processes and tools (eg, source control, issue tracking, test­-driven development, etc).</p>\r\n</li>\r\n	<li dir="ltr">\r\n<p dir="ltr">Database design and SQL is required. Experience with one or more of the following database platforms preferred: <a href="http://www.postgresql.org/">PostgreSQL</a>, <a href="https://www.mysql.com/">MySQL</a>, <a href="http://www.mongodb.org/">MongoDB</a>.</p>\r\n</li>\r\n	<li dir="ltr">\r\n<p dir="ltr">Mobile product development for the <a href="http://www.apple.com/iphone/">iPhone</a> and / or <a href="http://www.android.com/">Android</a> platform is a plus.</p>\r\n</li>\r\n	<li dir="ltr">\r\n<p dir="ltr">Must possess initiative, ambition, creativity, and strong communication skills.</p>\r\n</li>\r\n	<li dir="ltr">\r\n<p dir="ltr">Must thrive in a fast­-paced, collaborative, cross-­functional, agile environment.</p>\r\n</li>\r\n</ul>\r\n<h3 dir="ltr">To Apply:</h3>\r\n<p dir="ltr">If this sounds like a good fit, send us an email at <a href="mailto:contact@atmosferiq.com">contact@atmosferiq.com</a> and put “JOB: Software Developer” in the subject line. Include your resume as a .pdf file. If you join us, we promise you’ll work hard, learn a ton, be compensated well, and have a great time doing it.</p>\r\n\r\n</div>\r\n\r\n<hr />\r\n\r\n<div class="career">\r\n<h2 id="development-intern">Development Intern</h2>\r\n<p dir="ltr">Atmosferiq is a startup. We build stuff fast...we make mistakes...we learn...we repeat.  If you’ve worked in this kind of environment before, you get it. If you want work in this kind of environment, you’ll pick it up quickly.</p>\r\n<p dir="ltr">Atmosferiq is a marketing management tool designed specifically for local small businesses and marketing agencies to organize and understand the chaos of all of their marketing channels, both online &amp; offline. Our goal is to help give greater visibility to the entire marketing portfolio so they know whether it’s working and can make smarter decisions on the fly.</p>\r\n<p dir="ltr">As an intern developer at Atmosferiq, you’ll be given the ability to work across a variety of product features and work quickly to respond to customer feedback and turn around new product on a regular basis. You’ll be responsible for contributing quality production code to our numerous code bases, aligning and working with the design and business teams, and learning practical applications they don’t teach you in school!</p>\r\n\r\n<h3 dir="ltr">Stuff You Should Know:</h3>\r\n<ul>\r\n	<li dir="ltr">\r\n<p dir="ltr"><a href="https://www.ruby-lang.org/en/">Ruby</a> or <a href="http://rubyonrails.org/">Rails</a>.</p>\r\n</li>\r\n	<li dir="ltr">\r\n<p dir="ltr">HTML5, CSS3, <a href="http://jquery.com/">JQuery</a>, &amp; <a href="http://getbootstrap.com/">Twitter Bootstrap</a>