(353, 2, '2014-02-03 16:46:50', '2014-02-03 16:46:50', 'We give owners high-level visibility into their marketing, helping them to plan within their marketing budget, eliminate reactionary or ineffective spending, and create more targeted customer converting marketing campaigns. And with an ever-growing collection of supported marketing channels, we’ll help business owners identify, understand, and plan for new marketing opportunities.', 'Business Owners', 'Business owners are always on the go. They often manage all parts of their business on the fly, leaving little time to focus on the complex and ever-changing opportunities in marketing.', 'inherit', 'open', 'open', '', '52-revision-v1', '', '', '2014-02-03 16:46:50', '2014-02-03 16:46:50', '', 52, 'http://atmosferiq.com/uncategorized/52-revision-v1/', 0, 'revision', '', 0),
