(339, 1, '2014-01-25 23:23:25', '2014-01-25 23:23:25', 'If you have questions about our software, or wonder whether Atmosferiq is right for your business, please don''t hesitate to contact us.', 'Contact Atmosferiq', '', 'inherit', 'open', 'open', '', '18-revision-v1', '', '', '2014-01-25 23:23:25', '2014-01-25 23:23:25', '', 18, 'http://atmosferiq.thinktiv.webfactional.com/uncategorized/18-revision-v1/', 0, 'revision', '', 0),
(344, 2, '2014-01-29 16:11:25', '2014-01-29 16:11:25', 'A recent <a href="http://blog.biakelsey.com/index.php/2014/01/10/traditional-media-isnt-dead-yet-despite-increased-competition-from-digital-media/#.UukYsmRdXHm">research study from BIA Kelsey</a> has found that traditional media certainly drives significant ROI for SMBs. The study also found that of the Top 10 most used media of any kind, newspaper and direct mail were the only two to crack the Top 10, which is dominated by "free"social media tools, or lower cost email marketing, both of which reach much smaller audiences. While not cracking the Top 10, TV advertising topped the list by having the highest perceived ROI, with 50% of SMBs saying it has at least a 10x ROI.\r\n\r\nYour digital channels are often getting more of the ROI credit than your traditional as it''s in between the ad and the sale. Have you ever compared your offline activity to your online activity? Probably not as there hasn''t been anything available to help you do so. You need to be able to understand that it isn''t one form of media against the other...it''s seeing the world together as offline and online truly need each other to thrive.\r\n\r\nLastly, the study found that SMBs are looking to decrease the number of media used to advertise their business. While this very well might be the right thing to do, it''s difficult to figure out which media should stay in the mix. How do you know what you should keep and what you should take out of your mix?\r\n\r\nWhile a business needs to maintain consistency, it needs to be able to interchange what they''re using so not to oversaturate one audience and take advantage of potential customers in other channels. We believe that in today''s environment, a business needs to be marketing in as many places as possible and that they''re all interrelated. While digital has more specific measurements that you can see regularly, how are you attracting customers to your website or social channels? The key is understanding which traditional channels have the most significant impact on your digital and throttling that until it''s time to move onto the next one.\r\n\r\nAt the end of the day, you''re not going to know for sure until you start turning the dials and measuring the results to know whether you''ve got the right mix.\r\n\r\n&nbsp;', 'The ROI Story for Traditional Media', '', 'inherit', 'open', 'open', '', '343-revision-v1', '', '', '2014-01-29 16:11:25', '2014-01-29 16:11:25', '', 343, 'http://atmosferiq.com/uncategorized/343-revision-v1/', 0, 'revision', '', 0),
