(355, 2, '2014-02-03 16:51:19', '2014-02-03 16:51:19', 'Atmosferiq provides agencies a single platform to track and manage every channel for every client, eliminating hours of work in synthesizing and reporting so that marketers can focus on what''s really essential - studying activity and providing actionable insights. Our tools aggregate multi-channel marketing into a customer dashboard and intuitive timeline view to give marketers in-depth, up-to-date customer engagement activity.', 'Agencies', 'All marketing and advertising agencies are under pressure to stay current on the ever-evolving landscape of customer engagement, while still finding time to manage the existing plan and activities.', 'inherit', 'open', 'open', '', '20-revision-v1', '', '', '2014-02-03 16:51:19', '2014-02-03 16:51:19', '', 20, 'http://atmosferiq.com/uncategorized/20-revision-v1/', 0, 'revision', '', 0),
