>\r\n	<li dir="ltr">\r\n<p dir="ltr">Software development processes and tools (eg, source control, issue tracking, test­-driven development, etc).</p>\r\n</li>\r\n	<li dir="ltr">\r\n<p dir="ltr">Database design and SQL is required. Experience with one or more of the following database platforms preferred: <a href="http://www.postgresql.org/">PostgreSQL</a>, <a href="https://www.mysql.com/">MySQL</a>, <a href="http://www.mongodb.org/">MongoDB</a>.</p>\r\n</li>\r\n	<li dir="ltr">\r\n<p dir="ltr">Mobile product development for the <a href="http://www.apple.com/iphone/">iPhone</a> and / or <a href="http://www.android.com/">Android</a> platform is a plus.</p>\r\n</li>\r\n	<li dir="ltr">\r\n<p dir="ltr">Must possess initiative, ambition, creativity, and strong communication skills.</p>\r\n</li>\r\n	<li dir="ltr">\r\n<p dir="ltr">Must thrive in a fast­-paced, collaborative, cross-­functional, agile environment.</p>\r\n</li>\r\n</ul>\r\n<h3 dir="ltr"> To Apply:</h3>\r\nIf this sounds like a good fit, send us an email at <a href="mailto:contact@atmosferiq.com">contact@atmosferiq.com</a> and put “JOB: Development Intern” in the subject line. Include your resume as a .pdf file. If you join us, we promise you’ll work hard, learn a ton, be compensated well, and have a great time doing it.\r\n</div>', 'Careers', '', 'inherit', 'open', 'open', '', '360-revision-v1', '', '', '2014-03-09 00:35:43', '2014-03-09 00:35:43', '', 360, 'http://atmosferiq.com/uncategorized/360-revision-v1/', 0, 'revision', '', 0);
